    @RequestMapping("/createtasks")
    public List<String> createTasks(@RequestBody String jsonStr, HttpServletRequest request) throws Exception {
        setHttpOp(request);
        JSONArray jsonArr = new JSONArray(jsonStr);
        if(jsonArr.length()<1) {
            return null;
        }
        List<String> l = new LinkedList<>();
        for(int i=0; i<jsonArr.length(); i++) {
        	JSONObject jsonObj = jsonArr.getJSONObject(i);
        	JiraIssueBean jib = new JiraIssueBean();
            jib.setProjectKey(jsonObj.getString("projectKey"));
            jib.setComponentName(jsonObj.getString("componentName"));
            jib.setComponentId(jsonObj.getString("componentId"));
            jib.setFixVersionId(jsonObj.getString("fixVersionId"));
            jib.setCustomfield_10002Value(jsonObj.getString("customfield_10002Value"));
            jib.setIssueKey(jsonObj.getString("issuetype"));
            jib.setSummary(jsonObj.getString("summary"));
            jib.setDescription(jsonObj.getString("description"));
            l.add(createTask(jib));
        }
        return l;
    }
    
    public String createTask(JiraIssueBean jib) throws Exception {
        String responseBody = null;
        try {
            responseBody = httpOp.postHttpRequest(ISSUE_URL, jib.toJson());
        } catch (Exception ex) {
            if (ex.toString().contains("Field 'customfield_10002' cannot be set")) {
                try {
                    responseBody = httpOp.postHttpRequest(ISSUE_URL, jib.toJsonNo10002());
                } catch (Exception e) {
                    return String.format("ERROR Component %s Project %s ERROR", jib.getComponentName() + jib.getProjectKey());
                }
            }
        }
        String subTicketNum = new JSONObject(responseBody).getString("key");
        return subTicketNum;
    }

    @RequestMapping("/createissuelink")
    public List<String> createIntegrationTestingIssueLink(
    		@RequestParam(name="inward") String inward, 
    		@RequestParam(name="outwards") String outwards, 
    		HttpServletRequest request) throws Exception {
    	setHttpOp(request);
    	String[] outwardArr = outwards.split(",");
    	if(outwardArr==null || outwardArr.length<1)
    		return null;
    	List<String> l = new LinkedList<>();
    	for(String outward: outwardArr) {
    		try {
		        String postBody = "{\"type\": " + "{\"name\": \"Integration Testing\"}," + "\"inwardIssue\": {\"key\": \""
		                + inward + "\" }," + "\"outwardIssue\": {\"key\": \"" + outward + "\"}}";
		        httpOp.postHttpRequest(ISSUELINK_URL, postBody);
    		}catch(Exception ex) {
    			l.add(outward);
    		}
    	}
        return l;
    }

    public boolean verifyAuth(String username, String password) throws Exception {
        String postBody = String.format("{\"username\": \"%s\", \"password\": \"%s\"}", username, password);
        httpOp.postHttpRequest("https://jira.successfactors.com/rest/auth/1/session", postBody);
        return true;
    }

    @RequestMapping("/getversionid")
    public String getVersionId4Project(
    		@RequestParam(name="projectkey") String projectKey, 
    		@RequestParam(name="versionname") String versionName,
    		HttpServletRequest request) throws Exception {
        String responseBody = httpOp.getHttpRequest(String.format("%s/%s/versions", PROJECT_URL, projectKey));
        JSONArray jsonArrPro = new JSONArray(responseBody);
        for (int i = 0; i < jsonArrPro.length(); i++) {
            JSONObject jsonObj = jsonArrPro.getJSONObject(i);
            if (jsonObj.getString("name").trim().equalsIgnoreCase(versionName)) {
                return jsonObj.getString("id");
            }
        }
        return null;
    }
    
    @RequestMapping("/getissue")
    public JiraIssueBean getIssue(@RequestParam(name="issue_id") String IssueId, HttpServletRequest request) throws Exception {
        setHttpOp(request);
        String responseBody = httpOp.getHttpRequest(ISSUE_URL + "/" + IssueId);
        JiraIssueBean jib = new JiraIssueBean();
        JSONObject jsonObj = new JSONObject(responseBody);
        jib.setIssueKey(jsonObj.getString("key"));
        jib.setProjectKey(jsonObj.getJSONObject("fields").getJSONObject("project").getString("key"));
        // no need to set components
        // only support single fix version
        if(jsonObj.getJSONObject("fields").getJSONArray("fixVersions")==null||
        		jsonObj.getJSONObject("fields").getJSONArray("fixVersions").length()<1)
        	throw new Exception("no fixversions");
        jib.setFixVersionId(
                jsonObj.getJSONObject("fields").getJSONArray("fixVersions").getJSONObject(0).getString("id"));
        jib.setFixVersionName(
                jsonObj.getJSONObject("fields").getJSONArray("fixVersions").getJSONObject(0).getString("name"));
        // if customfield_10002 is not null
        if (jsonObj.getJSONObject("fields").has("customfield_10002")
                && jsonObj.getJSONObject("fields").get("customfield_10002") != JSONObject.NULL)
            jib.setCustomfield_10002Value(
                    jsonObj.getJSONObject("fields").getJSONObject("customfield_10002").getString("value"));
        // jib.setIssuetype(jsonObj.getJSONObject("fields").getJSONObject("issuetype").getString("id"));
        jib.setSummary(jsonObj.getJSONObject("fields").getString("summary"));
        jib.setDescription(jsonObj.getJSONObject("fields").getString("description"));
        return jib;
    }

