    public List<TreeNodeBean> getAllProject() throws Exception {
        List<TreeNodeBean> tnbList = new LinkedList<>();
        String responseBody = httpOp.getHttpRequest(PROJECT_URL);
        JSONArray jsonArrPro = new JSONArray(responseBody);
        for (int i = 0; i < jsonArrPro.length(); i++) {
            TreeNodeBean tnd = new TreeNodeBean();
            tnd.setText(jsonArrPro.getJSONObject(i).getString("key"));
            tnd.setHint(jsonArrPro.getJSONObject(i).getString("name"));
            tnbList.add(tnd);
        }
        Collections.sort(tnbList, new Comparator<TreeNodeBean>() {
            @Override
            public int compare(TreeNodeBean b1, TreeNodeBean b2) {
                return b1.getText().compareTo(b2.getText());
            }
        });

        return tnbList;
    }

    public Map<String, String> getAllComponents(String projectKey) throws Exception {
        Map<String, String> componentsMap = new HashMap<>();
        String responseBody = httpOp.getHttpRequest(PROJECT_URL + "/" + projectKey + "/components");
        JSONArray jsonArrPro = new JSONArray(responseBody);
        for (int i = 0; i < jsonArrPro.length(); i++) {
            componentsMap.put(jsonArrPro.getJSONObject(i).getString("id"),
                    jsonArrPro.getJSONObject(i).getString("name"));
        }

        List<Map.Entry<String, String>> list = new LinkedList<Map.Entry<String, String>>(componentsMap.entrySet());
        Collections.sort(list, new Comparator<Map.Entry<String, String>>() {
            public int compare(Map.Entry<String, String> o1, Map.Entry<String, String> o2) {
                return (o1.getValue()).compareTo(o2.getValue());
            }
        });

        Map<String, String> sortedMap = new LinkedHashMap<String, String>();
        for (Map.Entry<String, String> entry : list) {
            sortedMap.put(entry.getKey(), entry.getValue());
        }

        return sortedMap;
    }
    
